import React, {useState} from "react";

export const Register = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPass] = useState('');
    const [name, setName] = useState('');

    const handleSubmit = (e) => {
        
        // page gets reloaded and state gets lost
        e.preventDefault()

        console.log(email);
    }

    return (
        <div className="auth-form-container">
            <form className = "register-form" onSubmit = {handleSubmit}>
                <h2> Register </h2>
                <label htmlfor="name">Full name:</label>
                <input value={name}  onChange={(e)=>setName(e.target.value)} 
                type="text" placeholder="Your Name" id="name" name="name"/>
                <label htmlfor="email">Email:</label>
                <input value={email}  onChange={(e)=>setEmail(e.target.value)} 
                 type="email" placeholder="youremail@gmail.com" id="email" name="email"/>
                <label htmlfor = "password">Password:</label>
                <input value = {password}  onChange={(e)=>setPass(e.target.value)} 
                 type = "password" placeholder="********" id="password" name="password"/>
                <button className="register-button" type="submit">Register</button>
            </form>
            <button className="link-btn" onClick={() => props.onFormSwitch('login')}>Already have an acccount? Log-in here</button>
        </div>
    )
}
